import React from 'react';
import Navbar from './pages/navbar';
import ProductsList from './components/mainpage/productslist';
import ProductsListItem from './components/mainpage/productslistitem';

const App = () => {
  return (
    <React.Fragment>
    <>
      <Navbar />
      <ProductsList/>
      <ProductsListItem/>
    </>
    </React.Fragment>
  )
}

export default App;
